import {useState} from "react";
import "../../css/filter/sex.css";

function Sex() {
    const [cur, setCur] = useState("무관");

    return (
        <div>
            <Button className={cur === '무관' ? "activeButton" : "inactiveButton"}>무관</Button>
            <Button className={cur === '남성' ? "activeButton" : "inactiveButton"}>남성</Button>
            <Button className={cur === '여성' ? "activeButton" : "inactiveButton"}>여성</Button>
        </div>
    )
}

export default Sex;
